function animateValue(obj,start,end,duration){let startTimestamp=null;const step=timestamp=>{startTimestamp||(startTimestamp=timestamp);const progress=Math.min((timestamp-startTimestamp)/duration,1);obj.innerHTML=Math.floor(progress*(end-start)+start),progress<1&&window.requestAnimationFrame(step)};window.requestAnimationFrame(step)}const objs=document.getElementsByClassName("countdown");for(let obj of objs)setInterval(animateValue(obj,100,0,3e3),2e3);const objs2=document.getElementsByClassName("countup");for(let obj of objs2)animateValue(obj,0,100,5e3);var elem=document.querySelector(".main-carousel");async function getArticles(){await fetch("https://cms.evest.com/wp-json/wp/v2/press_release?_embded").then(res=>res.json()).then(data=>{const article=data.map(post=>`\n  <div class="carousel-cell">\n    <a href="${post.url_link}" target="_blank">\n    <img src="${post.yoast_head_json.schema["@graph"][2].url}" alt="${post.title.rendered}" title="${post.title.rendered}" style="width:450px">\n    </a>\n  </div>`).join("");document.querySelector("#PressRelease").innerHTML=article});var flkty=new Flickity(elem,{cellAlign:"left",contain:!0,wrapAround:!0,freescroll:!0})}getArticles();